CREATE DEFINER=`root`@`localhost` PROCEDURE `addComputing`(userid varchar(20), coreCount1 int, ram1 int, gpu1 varchar(20), price1 int)
BEGIN
    /*DECLARE EXIT HANDLER FOR SQLEXCEPTION ROLLBACK;*/
    /*START TRANSACTION;*/
        CALL generateIDForTable('instance',@instanceid);
        CALL generateIDForTable('subscription',@subid);
        
        SELECT computeID into @computeid from computing where coreCount=coreCount1 and ram=ram1 and gpu=gpu1 and price=price1;
        SELECT instanceID into @inst FROM instance WHERE computeID=@computeid and allocated=0 limit 1;
        
        IF @inst IS NULL THEN
				UPDATE instance SET allocated = 1 where instanceID=@inst;               
		ELSE
			SELECT -1;
        END IF;
        
        set @startDate = NOW();
		
        SET @subkey = 0;
        WHILE @subkey!=1 DO
			IF EXISTS(SELECT * FROM subscription WHERE subscriptionID=@subid) = 0 THEN
				SET @subkey = 1;
			ELSE
				CALL generateIDForTable('subscription',@subid);
			END IF;
		END WHILE;
     
        set sql_mode ='';
        INSERT INTO subscription (subscriptionID, userID, instanceID, startDate, endDate) values (@subid, userid, @inst, @startDate, '0000-00-00 00:00:00');
        SELECT @computeid, @inst, 'Congrates!, Transaction Successful!';
    /*COMMIT;*/
END ;;
