CREATE DEFINER=`root`@`localhost` PROCEDURE `generateIDForTable`(
IN tableName varchar(20),
OUT uid varchar(20)
)
BEGIN
    DECLARE prefix varchar(20);
    DECLARE pk varchar(20);
    CASE tableName
		WHEN  'authorization' THEN
		   SET prefix = 'AUT_';
           SET pk = 'authID';
		WHEN 'billing' THEN
		   SET prefix = 'BILL_';
           SET pk = 'billID';
		WHEN 'computing' THEN
		   SET prefix = 'COM_';
           SET pk = 'computeID';
		WHEN 'instance' THEN
		   SET prefix = 'INS_';
           SET pk = 'instanceID';
		WHEN 'logs' THEN
		   SET prefix = 'LOG_';
           SET pk = 'logID';
		WHEN 'paymentInformation' THEN
		   SET prefix = 'PAY_';
           SET pk = 'payID';
		WHEN 'storage' THEN
		   SET prefix = 'STO_';
           SET pk = 'storageID';
		WHEN 'subscription' THEN
		   SET prefix = 'SUB_';
           SET pk = 'subscriptionID';
		WHEN 'user' THEN
		   SET prefix = 'USR_';
           SET pk = 'userID';
	END CASE;
    SELECT CONCAT(prefix,FLOOR(RAND()*(1000000))) INTO uid;
END ;;
